import React , {useState} from 'react'
import logo from './assets/Mlogo.png'
import './Header.css';
import MenuIcon from '@material-ui/icons/Menu';
import HomeIcon from '@material-ui/icons/Home';
import CloudDownloadIcon from '@material-ui/icons/CloudDownload';
import PersonIcon from '@material-ui/icons/Person';
import IconButon from '@material-ui/core/IconButton';
import BottomNavigation from '@material-ui/core/BottomNavigation';
import BottomNavigationAction from '@material-ui/core/BottomNavigationAction';

const useStyles = makeStyles({
    root: {
      width: 500,
    },
  });

const Header = () => {
    const useStyles = makeStyles({
        root: {
          width: 500,
        },
      });
    const classes = useStyles();
    const [value, setValue] = useState('recents');

    const handleChange = (event, newValue) => {
      setValue(newValue);
    };

    return (
        <div>
        <div className="header">
            <div>
            <IconButon>
            <img 
            className="header__logo"
            src={logo}
            alt='portfolio logo'
            /> 
            </IconButon>
            </div>
            <div className="header__menu">
                <div className='header__links'>
                <IconButon>
                <HomeIcon className="header__icon" fontSize="large"/>
                </IconButon>
                <IconButon>
                <PersonIcon className="header__icon" fontSize="large"/>
                </IconButon>
                <IconButon>
                <CloudDownloadIcon className="header__icon" fontSize="large"/>
                </IconButon>
                </div>
            </div>
            <div className="header__burger">
                <IconButon>
                <MenuIcon className="header__burger" fontSize="large"/>
                </IconButon>
            </div>
        </div>
        <BottomNavigation value={value} onChange={handleChange} className={classes.root}>
        <BottomNavigationAction label="Home" value="home" icon={<HomeIcon className="header__icon" fontSize="large"/>} />
        <BottomNavigationAction label="About" value="about" icon={<PersonIcon className="header__icon" fontSize="large"/>} />
        <BottomNavigationAction label="Resume" value="resume" icon={<CloudDownloadIcon className="header__icon" fontSize="large"/>} />
        </BottomNavigation>
        </div>

    )
}

export default Header
